function ANV2R(v,rg,psl,ssl,rs,rd,mr)
{
var m;
var oc;
var r;
var rl;
var ss;
var lm="";
var rt=null;
var frt=null;
var ra=rg.split("|");
var pi=0;
var si=psl;
var oi=si+ssl;
var miwoo=oi+rs;
var miwo=miwoo+1;
for(ri=0;ri<ra.length;ri++)
{
r=ra[ri];
rl=r.length;
if(rl>=miwoo)
{
oc=r.charCodeAt(oi);
if((oc<42)&&(oc>32)&&(rl>=miwo))
{
if((psl==0)||(r.charAt(pi)=='A'))
{
m=r.substr(miwo,r.length-miwo);
}
else
{
m=lm.substr(0,r.charCodeAt(pi)-65);
m=m.concat(r.substr(miwo,r.length-miwo));
}
if((ssl!=0)&&(r.charAt(si)!='A'))
{
ss=r.charCodeAt(si)-65;
m=m.concat(lm.substr(lm.length-ss,ss));
}
switch(r.charAt(oi))
{
case"!":
if((v.length==m.length)&&(v.indexOf(m)==0))
{
rt=r.substr(oi+1,rs);
}
break;
case")":
if(v.lastIndexOf(m)==(v.length-m.length))
{
rt=r.substr(oi+1,rs);
}
break;
case"(":
if(v.indexOf(m)==0)
{
rt=r.substr(oi+1,rs);
}
break;
case"#":
if(v.search(m)!=-1)
{
rt=r.substr(oi+1,rs);
}
break;
case"&":
if(v.indexOf(m)!=-1)
{
rt=r.substr(oi+1,rs);
}
}
}
else
{
if((psl==0)||(r.charAt(pi)=='A'))
{
m=r.substr(miwoo,r.length-miwoo);
}
else
{
m=lm.substr(0,r.charCodeAt(pi)-65);
m=m.concat(r.substr(miwoo,r.length-miwoo));
}
if((ssl!=0)&&(r.charAt(si)!='A'))
{
ss=r.charCodeAt(si)-65;
m=m.concat(lm.substr(lm.length-ss,ss));
}
if(v.indexOf(m)!=-1)
{
rt=r.substr(oi,rs);
}
}
}
lm=m;
if(mr===1){
if(rt!==null){
rt=rt.toUpperCase();
if(rt===ANXCC){
if(frt===null){
frt=rt;
}
break;
}
if(frt===null){
frt=rt;
}else{
if(frt.indexOf(rt)===-1){
frt+=':'+rt;
}
}
}
}else{
if(rt!==null){
frt=rt.toUpperCase();
break;
}
}
}
return(frt==null)?rd:frt.replace(/\s+/g,"");
}
